import React from 'react';
import PropTypes from 'prop-types';

function Header(props) {
  const { title } = props;

  const headerStyle = {
    fontFamily: 'SF Pro, -apple-system, BlinkMacSystemFont, "Segoe UI", "Roboto", "Oxygen", "Ubuntu", "Cantarell", "Fira Sans", "Droid Sans", "Helvetica Neue", sans-serif',
    fontSize: '3em',
    fontWeight: 'bold',
    marginBottom: '25px',
  };

  return <div style={headerStyle}>{title}</div>;
}

Header.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Header;
